import React, {useState, useEffect} from 'react'
import {Link} from 'react-router-dom'
import axiosWithAuth from '../axiosWithAuth'
import MenuCard from './MenuCard'

export default function Menu({match}) {
    console.log(match)
const id = match.params.id
const [menus, setMenus] = useState([]);
console.log(menus)
useEffect(()=>{
    axiosWithAuth().get(`/api/trucks/${id}/menu`)
    .then(res =>{
        console.log(res.data.trucksMenu)
        setMenus(res.data.trucksMenu)
    })
    .catch(err=>{
        console.log(err, 'No data Cmoing in.')
    })
},[])


    return (
        <div>
        <h1>Current Menu:</h1>
        <div className='Menu'>
        {menus.map(()=>{
            return (
                <MenuCard
                menuName={menus.menuName}
                />
            )
        })}
        
        </div>

           <Link to={`/Operator/Dashboard/trucks/update/menu/create/${id}`}><h1>Click Create Menu</h1></Link>
        </div>
    )
}
